import React, { Component } from "react";
import logo from "../assets/img/logo2.png";
import cseaLogo from "../assets/img/csea black.png";
import TipsLogo from "../assets/img/preparation.jpeg";
import ExperianceLogo from "../assets/img/interview.png";
import PostLogo from "../assets/img/post.jpg";
import jQuery from "jquery";
import { $ } from "react-jquery-plugin";
import { HashLink as Link } from "react-router-hash-link";
import headimg from "../assets/img/interview-removebg-preview.png";

import './style.css';
import './style1.css';

class HomePage extends Component {
  componentDidMount() {
    // define( [ "jquery" ], function( $ ) {

    // Your code here

    // toggle = document.querySelectorAll(".toggle")[0];
    // nav = document.querySelectorAll("nav")[0];
    // toggle_open_text = 'Menu';
    // toggle_close_text = 'Close';

    // toggle.addEventListener('click', function() {
    // 	nav.classList.toggle('open');

    //   if (nav.classList.contains('open')) {
    //     toggle.innerHTML = toggle_close_text;
    //   } else {
    //     toggle.innerHTML = toggle_open_text;
    //   }
    // }, false);

    // setTimeout(function(){
    // 	nav.classList.toggle('open');
    // }, 800);

    // $(".menu").click(function () {
    //   $(this).parent().toggleClass("close");
    // });

    // why it doesn't work on firefox?

    //kid animation
    //GSAP variables

    //Navbar

    var nav = $("nav");
    var line = $("<div />").addClass("line");
    line.appendTo(".active");

    var active = nav.find(".active");
    var pos = 0;
    var wid = 0;

    if (active.length) {
      pos = active.position().left;
      wid = active.width();
      line.css({
        left: pos,
        width: wid,
      });
    }

    nav.find(" li a").click(function (e) {
      e.preventDefault();
      if (!$(this).parent().hasClass("active") && !nav.hasClass("animate")) {
        nav.addClass("animate");

        var _this = $(this);

        nav.find("li").removeClass("active");

        var position = _this.parent().position();
        var width = _this.parent().width();

        if (position.left >= pos) {
          line.animate(
            {
              width: position.left - pos + width,
            },
            300,
            function () {
              line.animate(
                {
                  width: width,
                  left: position.left,
                },
                150,
                function () {
                  nav.removeClass("animate");
                }
              );
              _this.parent().addClass("active");
            }
          );
        } else {
          line.animate(
            {
              left: position.left,
              width: pos - position.left + wid,
            },
            300,
            function () {
              line.animate(
                {
                  width: width,
                },
                150,
                function () {
                  nav.removeClass("animate");
                }
              );
              _this.parent().addClass("active");
            }
          );
        }

        pos = position.left;
        wid = width;
      }
    });

    // Timeline

    var items = document.querySelectorAll(".timeline li");

    function isElementInViewport(el) {
      var rect = el.getBoundingClientRect();
      return (
        rect.top >= 0 &&
        rect.left >= 0 &&
        rect.bottom <=
          (window.innerHeight || document.documentElement.clientHeight) &&
        rect.right <=
          (window.innerWidth || document.documentElement.clientWidth)
      );
    }

    function callbackFunc() {
      for (var i = 0; i < items.length; i++) {
        if (isElementInViewport(items[i])) {
          if (!items[i].classList.contains("in-view")) {
            items[i].classList.add("in-view");
          }
        } else if (items[i].classList.contains("in-view")) {
          items[i].classList.remove("in-view");
        }
      }
    }

    window.addEventListener("load", callbackFunc);
    window.addEventListener("scroll", callbackFunc);
